import {lazy} from 'react';

const Home = lazy(() => import('./Home'));

export default [
    {
        path: '/home',
        exact: true,
        public: true,
        component: 'Home'
    },
    {
        path: '/explore',
        exact: true,
        public: true,
        component: 'Explore'
    },
    {
        path: '/bookmark',
        exact: true,
        public: true,
        component: 'Bookmark'
    }
]
